def play_wav_with_volume(wav_bytes: bytes, volume_scale: float):
    """播放内存中的 wav，并调整音量"""
    buf = io.BytesIO(wav_bytes)
    with wave.open(buf, "rb") as wf:
        params = wf.getparams()
        frames = wf.readframes(wf.getnframes())

    sampwidth = params.sampwidth
    if sampwidth == 2:
        dtype = np.int16
    elif sampwidth == 1:
        dtype = np.uint8
    else:
        raise ValueError("仅支持8或16位wav")

    audio = np.frombuffer(frames, dtype=dtype).astype(np.float32)

    # 调整音量
    audio *= volume_scale
    if sampwidth == 2:
        np.clip(audio, -32768, 32767, out=audio)
    elif sampwidth == 1:
        np.clip(audio, 0, 255, out=audio)

    audio = audio.astype(dtype).tobytes()

    # 写到临时文件
    tmp_path = tempfile.NamedTemporaryFile(delete=False, suffix=".wav").name
    with wave.open(tmp_path, "wb") as wf_out:
        wf_out.setparams(params)
        wf_out.writeframes(audio)

    # 播放
    winsound.PlaySound(tmp_path, winsound.SND_FILENAME | winsound.SND_ASYNC)

# ------------------ 倒计时窗口 --------------------
class CountdownWindow(QtWidgets.QWidget):
    instances = []

    def __init__(self, state, time_secs, volume_scale_ref):
        super().__init__(None, Qt.WindowStaysOnTopHint | Qt.FramelessWindowHint)
        self.state = state
        self.volume_scale_ref = volume_scale_ref
        self.setAttribute(Qt.WA_TranslucentBackground, True)
        self.setFocusPolicy(Qt.StrongFocus)

        default_geom = [200, 200, 200, 100]
        geom = self.state.get("geometry", default_geom)
        self.setGeometry(*geom)

        self.label = QtWidgets.QLabel(self)
        self.label.setAlignment(Qt.AlignCenter)
        self.label.setStyleSheet("color:white; background-color: rgba(0,0,0,0.7);")
        layout = QtWidgets.QVBoxLayout(self)
        layout.setContentsMargins(0,0,0,0)
        layout.addWidget(self.label)

        self.remaining_secs = time_secs
        CountdownWindow.instances.append(self)
        self.update_label()

        self.timer = QTimer()
        self.timer.timeout.connect(self.update_countdown)
        self.timer.start(1000)

        self.apply_always_on_top()
        self._adjust_font()
        self.show()

    def apply_always_on_top(self):
        self.setWindowFlags(Qt.WindowStaysOnTopHint | Qt.FramelessWindowHint)
        self.show()

    def update_countdown(self):
        if self.remaining_secs > 0:
            self.remaining_secs -= 1
            self.update_label()
        else:
            self.timer.stop()
            self.remaining_secs = 0
            self.update_label()
            self.play_alarm()

    def play_alarm(self):
        play_wav_with_volume(SOUND_WAV_BYTES, self.volume_scale_ref())

    def update_label(self):
        m = self.remaining_secs // 60
        s = self.remaining_secs % 60
        self.label.setText(f"{m:02}:{s:02}")
        self._adjust_font()

    def _adjust_font(self):
        txt = self.label.text() or "00:00"
        w = max(10, self.width() - 20)
        h = max(10, self.height() - 20)
        font = QtGui.QFont("Segoe UI", 10, QtGui.QFont.Bold)
        low, high, best = 6, 1000, 6
        while low <= high:
            mid = (low + high) // 2
            font.setPointSize(mid)
            fm = QtGui.QFontMetrics(font)
            rect = fm.boundingRect(txt)
            if rect.width() <= w and rect.height() <= h:
                best = mid
                low = mid + 1
            else:
                high = mid - 1
        font.setPointSize(best)
        font.setBold(True)
        self.label.setFont(font)

    # ---------- 方向键移动 / Shift+方向键缩放并保存 ----------
    def keyPressEvent(self, event: QtGui.QKeyEvent):
        step = 5       # 方向键移动步长
        grow = 5       # Shift+方向键缩放步长
        geom = self.geometry()

        # 移动
        if event.key() == Qt.Key_Up:
            if event.modifiers() & Qt.ShiftModifier:
                geom.setHeight(max(20, geom.height() - grow))
            else:
                geom.moveTop(geom.top() - step)

        elif event.key() == Qt.Key_Down:
            if event.modifiers() & Qt.ShiftModifier:
                geom.setHeight(geom.height() + grow)
            else:
                geom.moveTop(geom.top() + step)

        elif event.key() == Qt.Key_Left:
            if event.modifiers() & Qt.ShiftModifier:
                geom.setWidth(max(20, geom.width() - grow))
            else:
                geom.moveLeft(geom.left() - step)

        elif event.key() == Qt.Key_Right:
            if event.modifiers() & Qt.ShiftModifier:
                geom.setWidth(geom.width() + grow)
            else:
                geom.moveLeft(geom.left() + step)

        # + 放大窗口
        elif event.key() in (Qt.Key_Plus, Qt.Key_Equal):   # 键盘+号或Shift+=
            geom.setWidth(geom.width() + grow)
            geom.setHeight(geom.height() + grow)

        # - 缩小窗口
        elif event.key() == Qt.Key_Minus:
            geom.setWidth(max(20, geom.width() - grow))
            geom.setHeight(max(20, geom.height() - grow))

        # . 关闭当前悬浮窗
        elif event.key() == Qt.Key_Period:
            self.close()
            CountdownWindow.instances.remove(self)
            return  # 不再保存几何

        self.setGeometry(geom)
        self._adjust_font()
        self.state["geometry"] = [geom.x(), geom.y(), geom.width(), geom.height()]
        save_state(self.state)

# ------------------ 主窗口 --------------------
class MainWindow(QtWidgets.QWidget):
    def __init__(self, state):
        super().__init__()
        self.state = state
        self.setWindowTitle("计时器")
        self.resize(400, 300)

        layout = QtWidgets.QVBoxLayout(self)

        self.input_edit = QtWidgets.QLineEdit(self)
        self.input_edit.setPlaceholderText("输入倒计时 (例如 0430)")
        layout.addWidget(self.input_edit)

        self.history_list = QtWidgets.QListWidget(self)
        layout.addWidget(self.history_list)

        # 音量滑块
        vol_layout = QtWidgets.QHBoxLayout()
        vol_label = QtWidgets.QLabel("音量")
        vol_layout.addWidget(vol_label)
        self.volume_slider = QtWidgets.QSlider(Qt.Horizontal)
        self.volume_slider.setRange(0, 1000)  # 0%-1000%
        vol_layout.addWidget(self.volume_slider)
        layout.addLayout(vol_layout)

        self.volume_scale = state.get("volume_scale", 1.0)
        self.volume_slider.setValue(int(self.volume_scale * 100))
        self.volume_slider.valueChanged.connect(self.on_volume_changed)

        btn_layout = QtWidgets.QHBoxLayout()
        self.start_btn = QtWidgets.QPushButton("开始倒计时")
        self.reset_btn = QtWidgets.QPushButton("重置历史")
        btn_layout.addWidget(self.start_btn)
        btn_layout.addWidget(self.reset_btn)
        layout.addLayout(btn_layout)

        self.start_btn.clicked.connect(self.start_timer)
        self.history_list.itemDoubleClicked.connect(self.apply_from_history)
        self.reset_btn.clicked.connect(self.reset_history)
        self.input_edit.returnPressed.connect(self.start_timer)

        # 创建可点击标签
        self.signature_label = QtWidgets.QLabel('<a href="https://cangshui.net">by:Cangshui.net</a>', self)
        self.signature_label.setAlignment(Qt.AlignRight | Qt.AlignBottom)
        self.signature_label.setOpenExternalLinks(False)  # 我们自己处理点击
        self.signature_label.setTextInteractionFlags(Qt.TextBrowserInteraction)

        # 点击打开浏览器
        self.signature_label.linkActivated.connect(lambda url: QDesktopServices.openUrl(QUrl(url)))
        self.signature_label.setAlignment(Qt.AlignRight | Qt.AlignBottom)
        layout.addWidget(self.signature_label)

        self.load_history()

    def on_volume_changed(self, value: int):
        self.volume_scale = value / 100.0
        self.state["volume_scale"] = self.volume_scale
        save_state(self.state)

    def get_volume_scale(self):
        return self.volume_scale

    def load_history(self):
        self.history_list.clear()
        for t in self.state.get("history", []):
            self.history_list.addItem(t)

    def save_history(self):
        items = [self.history_list.item(i).text() for i in range(self.history_list.count())]
        self.state["history"] = items
        save_state(self.state)

    def parse_time_input(self, text):
        text = text.strip()
        if not text:
            return None
        if ":" in text:
            try:
                m, s = map(int, text.split(":"))
                return m * 60 + s
            except:
                return None
        if text.isdigit():
            num = int(text)
            if num < 60:
                return num
            else:
                s = num % 100
                m = num // 100
                return m * 60 + s
        return None

    def start_timer(self):
        raw_text = self.input_edit.text()
        secs = self.parse_time_input(raw_text)
        if secs is None:
            QtWidgets.QMessageBox.warning(self, "格式错误", "请输入正确的时间，例如 0430 或 04:30")
            return
        display_text = f"{secs // 60:02}:{secs % 60:02}"
        self.input_edit.setText(display_text)

        if display_text not in [self.history_list.item(i).text() for i in range(self.history_list.count())]:
            self.history_list.addItem(display_text)
            self.save_history()

        CountdownWindow(self.state, secs, self.get_volume_scale)

    def apply_from_history(self, item):
        self.input_edit.setText(item.text())
        self.start_timer()

    def reset_history(self):
        reply = QtWidgets.QMessageBox.question(
            self, "确认重置", "确定要重置历史记录吗？",
            QtWidgets.QMessageBox.Yes | QtWidgets.QMessageBox.No
        )
        if reply == QtWidgets.QMessageBox.Yes:
            self.state["history"] = []
            save_state(self.state)
            self.load_history()

# ------------------ 主程序入口 --------------------
def main():
    app = QtWidgets.QApplication(sys.argv)
    state = load_state()
    win = MainWindow(state)
    win.show()
    sys.exit(app.exec_())

if __name__ == "__main__":
    main()
